import About from "./component/About/About";
import Intro from "./component/intro/Intro";
import Product from "./product/Product";
import ProductList from "./productList/ProductList";
function App(){
  return(
    <div className="App">
      <Intro/>
      <About/>
      <ProductList/>
    </div>
  )
}



export default App;
